    <div className='relative mt-6 bottom-0 bg-sky-400 w-full'>
      <div className='mt-16 inline-grid'>
        <div className="flex w-screen">
          {/* First Column - 10% */}

          <div className="w-3/12 bg-gray-700 ">
            <Link to="/"> <div className=" w-14 h-14 text-end mx-5 mt-2">
              <img className="rounded-full" src='./assets/images/logo.png' alt="Logo" />
            </div>
            </Link>
          </div>
          <div className="w-4/12 bg-gray-700 ">


          </div>
          <div className="w-4/12 bg-gray-700 ">


          </div>
        </div>
      </div>
    </div>
  )
}
export default Footer;
